import './App.css';

function UsefulResources() {
  return(
    <div class="container-fluid">
      <h1 class="mt-5 page-heading">Useful Resources</h1>
      <div class="row justify-content-center">
        <div class="col-lg-9">
          <h2 class="page-subheading">Qlab Scripts</h2>
          <p>Some text about my Qlab scripts.</p>

          <h2 class="page-subheading">Reaper Scripts</h2>
          <p>Some text about my Reaper scripts.</p>
        </div>
      </div>
    </div>
  );
}

export default UsefulResources;
